@CrimsonBum 2/2
 $ATNM forgot to remove the sentence from the prepared text.
The question is why the rejection was made. Is the survival data too too little meaningful? (The Form 10-Q said "Additional data from the SIERRA trial will be reported by year end 2022 including survival data".)

@hubermanlab I voted for needing to see convincing human data, but honestly it depends

For instance, are there potential downsides with adopting the tool (safety, effort, cost), and what are the potential upsides?

Safe, inexpensive, low effort and big potential upside -&gt; Very likely to try

